import React from "react";
import { Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import Resume from "./pages/Resume";

const App = () => {
  return (


    <div>

        <Routes>
          <Route path='/' element={<Home/>} />
          <Route path='/' element={<Resume/>} />
        </Routes>

    </div>
  );
};

export default App;
